$(document).on('click', 'a[href="#fullscreen"]', function() {
    modal = $(this).closest('.uk-modal-dialog');
    if(modal.hasClass('fullscreen')){
        modal.removeClass('fullscreen');
        $(this).find('[data-fullscreen="on"]').css('display', 'block');
        $(this).find('[data-fullscreen="off"]').css('display', 'none');
    }else{
        modal.addClass('fullscreen');
        $(this).find('[data-fullscreen="on"]').css('display', 'none');
        $(this).find('[data-fullscreen="off"]').css('display', 'block');
    }
    return false;
});
$(document).on('click', 'a[href="#close"]', function() {
    modal = $(this).closest('.uk-modal-dialog');
    if(modal.hasClass('fullscreen'))
        modal.removeClass('fullscreen');
    
    $(this).find('[data-fullscreen="on"]').css('display', 'block');
    $(this).find('[data-fullscreen="off"]').css('display', 'none');
});